import AddTransaction from './components/AddTransaction'

import {GlobalProvider} from './'

function App() {
  return (
  <div>
   <Header/>
   <div className="container">
      <Balance/>
      <IncomeExpenses/>
      <TransactionList/>
      <AddTransaction/>
   </div>
  </div>
  );
}

export default App;
